import React from 'react';
import {
  Container,
  Typography,
  Paper,
  Box,
  Grid,
  useTheme,
  Button,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'];
const timeSlots = ['9:00-10:00', '10:00-11:00', '11:00-12:00', '1:00-2:00', '2:00-3:00'];

const mockSchedule = {
  Monday: [{ time: '9:00-10:00', subject: 'Maths', batch: 'Batch 1', classroom: 'Room 101' }],
  Tuesday: [
    { time: '10:00-11:00', subject: 'Physics', batch: 'Batch 2', classroom: 'Room 102' },
    { time: '2:00-3:00', subject: 'Chemistry', batch: 'Batch 1', classroom: 'Room 103' },
  ],
  Wednesday: [{ time: '11:00-12:00', subject: 'Maths', batch: 'Batch 3', classroom: 'Room 101' }],
  Thursday: [],
  Friday: [{ time: '1:00-2:00', subject: 'Physics', batch: 'Batch 2', classroom: 'Room 102' }],
};

const TeacherSchedule = () => {
  const theme = useTheme();
  const navigate = useNavigate();

  const getScheduleCell = (day, slot) => {
    const classes = mockSchedule[day] || [];
    const scheduledClass = classes.find((cls) => cls.time === slot);
    if (scheduledClass) {
      return (
        <Paper
          elevation={3}
          sx={{
            p: 1,
            bgcolor: theme.palette.primary.light,
            color: theme.palette.primary.contrastText,
            borderRadius: 1,
            textAlign: 'center',
            fontWeight: 'medium',
          }}
        >
          <Typography variant="subtitle2">{scheduledClass.subject}</Typography>
          <Typography variant="caption">{scheduledClass.batch}</Typography>
          <br />
          <Typography variant="caption">{scheduledClass.classroom}</Typography>
        </Paper>
      );
    }
    return null;
  };

  return (
    <Container sx={{ mt: 6, mb: 6 }}>
      <Button variant="contained" color="secondary" onClick={() => navigate('/teacher')} sx={{ mb: 3 }}>
        Back to Dashboard
      </Button>
      <Typography variant="h4" gutterBottom fontWeight="bold" color="primary">
        Teacher Timetable
      </Typography>
      <Paper elevation={6} sx={{ p: 3, borderRadius: 3, overflowX: 'auto' }}>
        <Grid container spacing={0} sx={{ minWidth: 720 }}>
          <Grid item xs={2} sx={{ borderBottom: 1, borderRight: 1, borderColor: 'divider', p: 1 }}>
            <Typography variant="subtitle1" fontWeight="bold">
              Time / Day
            </Typography>
          </Grid>
          {days.map((day) => (
            <Grid
              key={day}
              item
              xs={2}
              sx={{
                borderBottom: 1,
                borderRight: 1,
                borderColor: 'divider',
                backgroundColor: theme.palette.action.hover,
                p: 1,
                textAlign: 'center',
              }}
            >
              <Typography variant="subtitle1" fontWeight="bold">
                {day}
              </Typography>
            </Grid>
          ))}

          {timeSlots.map((slot) => (
            <React.Fragment key={slot}>
              <Grid
                item
                xs={2}
                sx={{
                  borderBottom: 1,
                  borderRight: 1,
                  borderColor: 'divider',
                  p: 1,
                  fontWeight: 'medium',
                }}
              >
                {slot}
              </Grid>
              {days.map((day) => (
                <Grid
                  key={day + slot}
                  item
                  xs={2}
                  sx={{
                    borderBottom: 1,
                    borderRight: 1,
                    borderColor: 'divider',
                    p: 1,
                    minHeight: 60,
                  }}
                >
                  {getScheduleCell(day, slot)}
                </Grid>
              ))}
            </React.Fragment>
          ))}
        </Grid>
      </Paper>
    </Container>
  );
};

export default TeacherSchedule;
